from src.starkware.cairo.common.ec import StarkCurve, assert_on_curve, ec_add

from starkware.cairo.common.alloc import alloc
from starkware.cairo.common.cairo_builtins import EcOpBuiltin
from starkware.cairo.common.ec_point import EcPoint
from starkware.cairo.common.memset import memset

const M_MAX_BITS = 252;
const FIRST_P_POWER = 251;
const SECOND_P_POWER = 196;
const THIRD_P_POWER = 192;
const FOURTH_P_POWER = 0;

func ec_mul_cairo{}(m: felt, p: EcPoint) -> (r: EcPoint) {
    return cairo_ec_op(p=EcPoint(x=0, y=0), m=m, q=p);
}

// Computes p + m * q on the elliptic curve.
// Because the simulate_builtin_ec_op_with_cairo function cannot handle inputs where additions of
// points with the same x coordinate arise during the computation, this function adds and subtracts
// a nondeterministic point s to the computation, so that regardless of input, the probability that
// such additions arise will become negligibly small.
// The precise computation is therefore:
// ((p + s) + m * q) - s
// so that the inputs to the builtin itself are (p + s), m, and q.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   p - an EC point.
//   m - the multiplication coefficient of Q.
//   q - an EC point.
//
// Returns:
//   r = p + m * q.
//
// Assumptions:
//   p and q are valid points on the curve.
func cairo_ec_op{}(p: EcPoint, m: felt, q: EcPoint) -> (r: EcPoint) {
    alloc_locals;

    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (q.y == 0) {
        return (r=p);
    }

    local s: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import random_ec_point
        from starkware.python.utils import to_bytes

        # Define a seed for random_ec_point that's dependent on all the input, so that:
        #   (1) The added point s is deterministic.
        #   (2) It's hard to choose inputs for which the builtin will fail.
        seed = b"".join(map(to_bytes, [ids.p.x, ids.p.y, ids.m, ids.q.x, ids.q.y]))
        ids.s.x, ids.s.y = random_ec_point(FIELD_PRIME, ALPHA, BETA, seed)
    %}
    assert_on_curve(s);
    let p_plus_s: EcPoint = ec_add(p, s);

    let (r_plus_s) = simulate_builtin_ec_op_with_cairo(p=p_plus_s, m=m, q=q);
    let r: EcPoint = ec_add(r_plus_s, EcPoint(x=s.x, y=-s.y));
    return (r=r);
}

// Returns the result of the EC operation P + m * Q.
// where P = (p_x, p_y), Q = (q_x, q_y) are points on the elliptic curve defined as
// y^2 = x^3 + alpha * x + beta (mod prime).

// Mimics the operation of the AIR, so that this function fails whenever the builtin AIR
// would not yield a correct result, i.e. when any part of the computation attempts to add
// two points with the same x coordinate.
func simulate_builtin_ec_op_with_cairo{}(p: EcPoint, m: felt, q: EcPoint) -> (r: EcPoint) {
    alloc_locals;
    // Assert that the points are on the curve and are not the point at infinity.
    tempvar rhs_p = (p.x * p.x + StarkCurve.ALPHA) * p.x + StarkCurve.BETA;
    assert p.y * p.y = rhs_p;
    tempvar rhs_q = (q.x * q.x + StarkCurve.ALPHA) * q.x + StarkCurve.BETA;
    assert q.y * q.y = rhs_q;

    let (local m_bit_unpacking: felt*) = alloc();  // Starts from lsb.
    %{
        curr_m = ids.m
        for i in range(ids.M_MAX_BITS):
            memory[ids.m_bit_unpacking + i] = curr_m % 2
            curr_m = curr_m >> 1
    %}

    // Verify that the bit unpacking is of a number num smaller than PRIME.
    verify_bit_unpacking_is_reduced(num=m, unpacking=m_bit_unpacking);

    // Compute the result.
    let result = _ec_op_inner(
        partial_sum=p, doubled_point=q, m_bit_unpacking=m_bit_unpacking, index=0, curr_m=m
    );

    // Assert that the result is on the curve.
    assert_on_curve(p=result);

    // Output the result.
    return (r=result);
}

// Asserts that an EcOpBuiltin instance is valid.
func verify_simulate_builtin_ec_op_with_cairo{}(input: EcOpBuiltin) {
    let (r) = simulate_builtin_ec_op_with_cairo(p=input.p, m=input.m, q=input.q);
    assert input.r = r;
    return ();
}

// Computes the EC operation partial_sum + curr_m * doubled_point.
// It is called recursively, with the recursion being terminated when the index reaches M_MAX_BITS.
// The function also verifies that the bit unpacking is indeed of curr_m (modulo PRIME).
func _ec_op_inner{}(
    partial_sum: EcPoint, doubled_point: EcPoint, m_bit_unpacking: felt*, index: felt, curr_m: felt
) -> EcPoint {
    alloc_locals;
    if (index == M_MAX_BITS) {
        assert curr_m = 0;
        return partial_sum;
    }

    if (doubled_point.x == partial_sum.x) {
        %{ assert False, "ec_op failed." %}
        jmp rel 0;
    }

    if (m_bit_unpacking[0] == 1) {
        // Inline ec_add for input p=partial_sum, q=doubled_point.
        // Note: no need to compare doubled_point.y to 0 since simulate_builtin_ec_op_with_cairo
        // has already verified that p is not the point at infinity and every time partial_sum
        // gets updated, it is the addition of two points with different x coordinates.
        // We also do not need to address the case where partial_sum.x == doubled_point.x because
        // we have already verified that it is not the case.
        tempvar slope = (partial_sum.y - doubled_point.y) / (partial_sum.x - doubled_point.x);
        tempvar r_x = slope * slope - partial_sum.x - doubled_point.x;
        tempvar partial_sum = EcPoint(x=r_x, y=slope * (partial_sum.x - r_x) - partial_sum.y);
    } else {
        assert m_bit_unpacking[0] = 0;
        tempvar partial_sum = partial_sum;
    }

    // Inline ec_double for input p=doubled_point.
    // Note: we do not need to compare doubled_point.y to 0 since simulate_builtin_ec_op_with_cairo
    // has already verified that q is not the point at infinity and doubled_point = 2**index * q
    // and the EC group is of an odd order.
    tempvar slope = (3 * doubled_point.x * doubled_point.x + StarkCurve.ALPHA) / (
        doubled_point.y + doubled_point.y
    );
    tempvar r_x = slope * slope - doubled_point.x - doubled_point.x;
    local doubled_point: EcPoint = EcPoint(
        x=r_x, y=slope * (doubled_point.x - r_x) - doubled_point.y
    );

    if (doubled_point.x == partial_sum.x) {
        %{ assert False, "ec_op failed." %}
        jmp rel 0;
    }

    if (m_bit_unpacking[1] == 1) {
        // Inline ec_add for input p=partial_sum, q=doubled_point.
        tempvar slope = (partial_sum.y - doubled_point.y) / (partial_sum.x - doubled_point.x);
        tempvar r_x = slope * slope - partial_sum.x - doubled_point.x;
        tempvar partial_sum = EcPoint(x=r_x, y=slope * (partial_sum.x - r_x) - partial_sum.y);
    } else {
        assert m_bit_unpacking[1] = 0;
        tempvar partial_sum = partial_sum;
    }

    // Inline ec_double for input p=doubled_point.
    tempvar slope = (3 * doubled_point.x * doubled_point.x + StarkCurve.ALPHA) / (
        doubled_point.y + doubled_point.y
    );
    tempvar r_x = slope * slope - doubled_point.x - doubled_point.x;
    let doubled_point: EcPoint = EcPoint(
        x=r_x, y=slope * (doubled_point.x - r_x) - doubled_point.y
    );

    return _ec_op_inner(
        partial_sum=partial_sum,
        doubled_point=doubled_point,
        m_bit_unpacking=m_bit_unpacking + 2,
        index=index + 2,
        curr_m=(curr_m - m_bit_unpacking[0] - m_bit_unpacking[1] - m_bit_unpacking[1]) / 4,
    );
}

// Asserts that the bit unpacking is of a number num smaller than PRIME.
func verify_bit_unpacking_is_reduced{}(num: felt, unpacking: felt*) {
    if (unpacking[FIRST_P_POWER] == 0) {
        return ();
    }
    memset(dst=unpacking + SECOND_P_POWER + 1, value=0, n=FIRST_P_POWER - SECOND_P_POWER - 1);
    if (unpacking[SECOND_P_POWER] == 0) {
        return ();
    }
    memset(dst=unpacking + THIRD_P_POWER + 1, value=0, n=SECOND_P_POWER - THIRD_P_POWER - 1);
    if (unpacking[THIRD_P_POWER] == 0) {
        return ();
    }
    memset(dst=unpacking + FOURTH_P_POWER + 1, value=0, n=THIRD_P_POWER - FOURTH_P_POWER - 1);
    assert unpacking[FOURTH_P_POWER] = 0;
    return ();
}

// Functions for various actions on the STARK curve:
//   y^2 = x^3 + alpha * x + beta
// where alpha = 1 and beta = 0x6f21413efbe40de150e596d72f7a8c5609ad26c15c915c1f4cdfcb99cee9e89.
// The point at infinity is represented as (0, 0).

from starkware.cairo.common.cairo_builtins import EcOpBuiltin
from starkware.cairo.common.ec_point import EcPoint
from starkware.cairo.common.math import is_quad_residue

namespace StarkCurve {
    const ALPHA = 1;
    const BETA = 0x6f21413efbe40de150e596d72f7a8c5609ad26c15c915c1f4cdfcb99cee9e89;
    const ORDER = 0x800000000000010ffffffffffffffffb781126dcae7b2321e66a241adc64d2f;
    const GEN_X = 0x1ef15c18599971b7beced415a40f0c7deacfd9b0d1819e03d723d8bc943cfca;
    const GEN_Y = 0x5668060aa49730b7be4801df46ec62de53ecd11abe43a32873000c36e8dc1f;
}

// Asserts that an EC point is on the STARK curve.
//
// Arguments:
//   p - an EC point.
func assert_on_curve(p: EcPoint) {
    // Because the curve order is odd, there is no point (except (0, 0), which represents the point
    // at infinity) with y = 0.
    if (p.y == 0) {
        assert p.x = 0;
        return ();
    }
    tempvar rhs = (p.x * p.x + StarkCurve.ALPHA) * p.x + StarkCurve.BETA;
    assert p.y * p.y = rhs;
    return ();
}

// Doubles a point (computes p + p) on the elliptic curve.
//
// Arguments:
//   p - an EC point.
//
// Returns:
//   r = p + p.
//
// Assumptions:
//   p is a valid point on the curve.
func ec_double(p: EcPoint) -> (r: EcPoint) {
    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (p.y == 0) {
        return (r=p);
    }
    tempvar slope = (3 * p.x * p.x + StarkCurve.ALPHA) / (2 * p.y);
    tempvar r_x = slope * slope - p.x - p.x;
    return (r=EcPoint(x=r_x, y=slope * (p.x - r_x) - p.y));
}

// Adds two points on the EC.
//
// Arguments:
//   p - an EC point.
//   q - an EC point.
//
// Returns:
//   r = p + q.
//
// Assumptions:
//   p and q are valid points on the curve.
func ec_add(p: EcPoint, q: EcPoint) -> (r: EcPoint) {
    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (p.y == 0) {
        return (r=q);
    }
    if (q.y == 0) {
        return (r=p);
    }
    if (p.x == q.x) {
        if (p.y == q.y) {
            return ec_double(p);
        }
        // In this case, because p and q are on the curve, p.y = -q.y.
        return (r=EcPoint(x=0, y=0));
    }
    tempvar slope = (p.y - q.y) / (p.x - q.x);
    tempvar r_x = slope * slope - p.x - q.x;
    return (r=EcPoint(x=r_x, y=slope * (p.x - r_x) - p.y));
}

// Subtracts a point from another on the EC.
//
// Arguments:
//   p - an EC point.
//   q - an EC point.
//
// Returns:
//   r = p - q.
//
// Assumptions:
//   p and q are valid points on the curve.
func ec_sub(p: EcPoint, q: EcPoint) -> (r: EcPoint) {
    return ec_add(p=p, q=EcPoint(x=q.x, y=-q.y));
}

// Computes p + m * q on the elliptic curve.
// Because the EC operation builtin cannot handle inputs where additions of points with the same x
// coordinate arise during the computation, this function adds and subtracts a nondeterministic
// point s to the computation, so that regardless of input, the probability that such additions
// arise will become negligibly small.
// The precise computation is therefore:
// ((p + s) + m * q) - s
// so that the inputs to the builtin itself are (p + s), m, and q.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   p - an EC point.
//   m - the multiplication coefficient of Q.
//   q - an EC point.
//
// Returns:
//   r = p + m * q.
//
// Assumptions:
//   p and q are valid points on the curve.
func ec_op{ec_op_ptr: EcOpBuiltin*}(p: EcPoint, m: felt, q: EcPoint) -> (r: EcPoint) {
    alloc_locals;

    // (0, 0), which represents the point at infinity, is the only point with y = 0.
    if (q.y == 0) {
        return (r=p);
    }

    local s: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import random_ec_point
        from starkware.python.utils import to_bytes

        # Define a seed for random_ec_point that's dependent on all the input, so that:
        #   (1) The added point s is deterministic.
        #   (2) It's hard to choose inputs for which the builtin will fail.
        seed = b"".join(map(to_bytes, [ids.p.x, ids.p.y, ids.m, ids.q.x, ids.q.y]))
        ids.s.x, ids.s.y = random_ec_point(FIELD_PRIME, ALPHA, BETA, seed)
    %}
    assert_on_curve(s);
    let p_plus_s: EcPoint = ec_add(p, s);

    assert ec_op_ptr.p = p_plus_s;
    assert ec_op_ptr.m = m;
    assert ec_op_ptr.q = q;
    let r: EcPoint = ec_add(ec_op_ptr.r, EcPoint(x=s.x, y=-s.y));
    let ec_op_ptr = ec_op_ptr + EcOpBuiltin.SIZE;
    return (r=r);
}

// Computes m * p on the elliptic curve.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   m - the multiplication coefficient of p.
//   p - an EC point.
//
// Returns:
//   r = m * p.
//
// Assumptions:
//   p is a valid point on the curve.
func ec_mul{ec_op_ptr: EcOpBuiltin*}(m: felt, p: EcPoint) -> (r: EcPoint) {
    return ec_op(p=EcPoint(x=0, y=0), m=m, q=p);
}

// Computes p + m[0] * q[0] + m[1] * q[1] + ... m[len - 1] * q[len - 1] on the elliptic curve.
// Because the EC operation builtin cannot handle inputs where additions of points with the same x
// coordinate arise during the computation, this function adds and removes a nondeterministic
// point s to the computation, so that regardless of input, the probability that such additions
// arise will become negligibly small.
// The precise computation is therefore:
// ((p + s) + m[0] * q[0] + m[1] + q[1] + ... + m[len - 1] * q[len - 1]) - s.
//
// Arguments:
//   ec_op_ptr - the ec_op builtin pointer.
//   p - an EC point.
//   m - an array of multiplication coefficients.
//   q - an array of EC points.
//   len - the number of points in q.
//
// Returns:
//   r = p + m[0] * q[0] + m[1] * q[1] + ... + m[len - 1] * q[len - 1].
// Assumptions:
//   * All given EC points are on the STARK curve.
//   * len <= 1000.
func chained_ec_op{ec_op_ptr: EcOpBuiltin*}(p: EcPoint, m: felt*, q: EcPoint*, len: felt) -> (
    r: EcPoint
) {
    alloc_locals;
    local s: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import random_ec_point
        from starkware.python.utils import to_bytes

        n_elms = ids.len
        assert isinstance(n_elms, int) and n_elms >= 0, \
            f'Invalid value for len. Got: {n_elms}.'
        if '__chained_ec_op_max_len' in globals():
            assert n_elms <= __chained_ec_op_max_len, \
                f'chained_ec_op() can only be used with len<={__chained_ec_op_max_len}. ' \
                f'Got: n_elms={n_elms}.'

        # Define a seed for random_ec_point that's dependent on all the input, so that:
        #   (1) The added point s is deterministic.
        #   (2) It's hard to choose inputs for which the builtin will fail.
        seed = b"".join(
            map(
                to_bytes,
                [
                    ids.p.x,
                    ids.p.y,
                    *memory.get_range(ids.m, n_elms),
                    *memory.get_range(ids.q.address_, 2 * n_elms),
                ],
            )
        )
        ids.s.x, ids.s.y = random_ec_point(FIELD_PRIME, ALPHA, BETA, seed)
    %}
    assert_on_curve(s);
    let p_plus_s: EcPoint = ec_add(p, s);
    let r_plus_s: EcPoint = _chained_ec_op_inner(p=p_plus_s, m=m, q=q, len=len);
    let r: EcPoint = ec_add(r_plus_s, EcPoint(x=s.x, y=-s.y));
    return (r=r);
}

func _chained_ec_op_inner{ec_op_ptr: EcOpBuiltin*}(
    p: EcPoint, m: felt*, q: EcPoint*, len: felt
) -> (r: EcPoint) {
    if (len == 0) {
        return (r=p);
    }
    // (0, 0), representing the point at infinity, is the only point for which y = 0.
    if (q.y == 0) {
        return _chained_ec_op_inner(p=p, m=&m[1], q=&q[1], len=len - 1);
    }
    assert ec_op_ptr.p = p;
    assert ec_op_ptr.m = m[0];
    assert ec_op_ptr.q = q[0];
    let r = ec_op_ptr.r;
    let ec_op_ptr = &ec_op_ptr[1];
    return _chained_ec_op_inner(p=r, m=&m[1], q=&q[1], len=len - 1);
}

// Recovers the y coordinate of a point on the EC.
//
// Arguments:
//   x - the x coordinate of an EC point.
//
// Returns:
//   p - one of the two EC points with the given x coordinate (x, y).
//
// Assumptions:
//   There exists y such that (x, y) is on the curve. Otherwise the function's hint will throw a
//   python exception.
//
// Note:
//   This function will fail on x = 0 because there is no such point on the curve. The point at
//   infinity is represented as (0, 0), but this is just a representation, not actual coordinates.
func recover_y(x: felt) -> (p: EcPoint) {
    alloc_locals;
    local p: EcPoint;
    %{
        from starkware.crypto.signature.signature import ALPHA, BETA, FIELD_PRIME
        from starkware.python.math_utils import recover_y
        ids.p.x = ids.x
        # This raises an exception if `x` is not on the curve.
        ids.p.y = recover_y(ids.x, ALPHA, BETA, FIELD_PRIME)
    %}
    assert p.x = x;
    assert_on_curve(p);
    return (p=p);
}

// Checks if `x` represents the x coordinate of a point on the curve.
//
// Arguments:
//   x - a field element.
//
// Returns:
//   res - TRUE if `x` represents the x coordinate of a point on the curve, FALSE otherwise.
// Note:
//   Returns FALSE on x = 0 because there is no such point on the curve. The point at
//   infinity is represented as (0, 0), but this is just a representation, not actual coordinates.
func is_x_on_curve(x: felt) -> felt {
    return is_quad_residue(x=x * x * x + StarkCurve.ALPHA * x + StarkCurve.BETA);
}

// Represents a point on an elliptic curve.
struct EcPoint {
    x: felt,
    y: felt,
}

from starkware.cairo.common.cairo_builtins import HashBuiltin

// Computes a hash chain of a sequence whose length is given at [data_ptr] and the data starts at
// data_ptr + 1. The hash is calculated backwards (from the highest memory address to the lowest).
// For example, for the 3-element sequence [x, y, z] the hash is:
//   h(3, h(x, h(y, z)))
// If data_length = 0, the function does not return (takes more than field prime steps).
func hash_chain{hash_ptr: HashBuiltin*}(data_ptr: felt*) -> (hash: felt) {
    struct LoopLocals {
        data_ptr: felt*,
        hash_ptr: HashBuiltin*,
        cur_hash: felt,
    }

    tempvar data_length = [data_ptr];
    tempvar data_ptr_end = data_ptr + data_length;
    // Prepare the loop_frame for the first iteration of the hash_loop.
    tempvar loop_frame = LoopLocals(
        data_ptr=data_ptr_end, hash_ptr=hash_ptr, cur_hash=[data_ptr_end]
    );

    hash_loop:
    let curr_frame = cast(ap - LoopLocals.SIZE, LoopLocals*);
    let current_hash: HashBuiltin* = curr_frame.hash_ptr;

    tempvar new_data = [curr_frame.data_ptr - 1];

    let n_elements_to_hash = [ap];
    // Assign current_hash inputs and allocate space for n_elements_to_hash.
    current_hash.x = new_data, ap++;
    current_hash.y = curr_frame.cur_hash;

    // Set the frame for the next loop iteration (going backwards).
    tempvar next_frame = LoopLocals(
        data_ptr=curr_frame.data_ptr - 1,
        hash_ptr=curr_frame.hash_ptr + HashBuiltin.SIZE,
        cur_hash=current_hash.result,
    );

    // Update n_elements_to_hash and loop accordingly. Note that the hash is calculated backwards.
    n_elements_to_hash = next_frame.data_ptr - data_ptr;
    jmp hash_loop if n_elements_to_hash != 0;

    // Set the hash_ptr implicit argument and return the result.
    let hash_ptr = next_frame.hash_ptr;
    return (hash=next_frame.cur_hash);
}

// Represents a Poseidon state.
struct PoseidonBuiltinState {
    s0: felt,
    s1: felt,
    s2: felt,
}

from starkware.cairo.lang.compiler.lib.registers import get_ap, get_fp_and_pc

// Takes the value of a label (relative to program base) and returns the actual runtime address of
// that label in the memory.
//
// Usage example:
//
// func do_callback(...) {
//     ...
// }
//
// func do_thing_then_callback(callback) {
//     ...
//     call abs callback;
// }
//
// func main() {
//     let (callback_address) = get_label_location(do_callback);
//     do_thing_then_callback(callback=callback_address);
// }
func get_label_location(label_value: codeoffset) -> (res: felt*) {
    let (_, pc_val) = get_fp_and_pc();

    ret_pc_label:
    return (res=pc_val + (label_value - ret_pc_label));
}

